client.on('message', message => {
    let args = message.content.substring(prefix.length).split(" ");
    
    switch (args[0]) {
        case '노래':

            function play(connection, message){
                var server = servers[message.guild.id];
    
                server.dispatcher = connection.play(ytdl(server.queue[0],{filter: "audio"}));
    
    
    
                server.dispatcher.on("finish", function(){
                   server.queue.shift();
                   if(server.queue[0]){
                       play(connection, message);
                   }else {
                       connection.disconnect();
                   }
                })
    
            }         
        
            if(!args[1]){
                message.channel.send("무엇을 플레이할 지 적어주세요!");
                return;
            }
            
            if(!message.member.voice.channel){
                message.channel.send("우선 음성채널에 들어가주세요!");
                return;
            }

            if(!servers[message.guild.id]) servers[message.guild.id] = {
                queue: []
            }
            var server = servers[message.guild.id];

            server.queue.push(args[1]);

            if(!message.member.voice.connection) message.member.voice.channel.join().then(function(connection){
                play(connection, message);
            })
        break;

        case '스킵':
            var server = servers[message.guild.id];
            if(server.dispatcher) server.dispatcher.end();
            message.channel.send("노래가 영레적이누;; 스킵함");
        break;

        case '나가':
            var server = servers[message.guild.id];
            if(message.member.voice.connection){
                for(var i = server.queue.length -1; i >= 0; i--){
                    server.queue.splice(i,1);
                }

                server.dispatcher.end();
                message.channel.send("안녕히 계세요 여러분! 전 이 세상의 모든 음악을 벗어 던지고 제 행복을 찾아 떠납니다! 여러분도 행복하세요~~!")
                console.log('stopped the queue');
            }

            if(message.guild.connection) message.member.voice.connection.disconnect();
        break;

    }
});

